import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router } from 'react-router-dom';
import Sidebar from './moviesidebar';
import NavDashbord from './navdashbord';

function Admin() {
  return (
    <Router>
      <div className="App">
        <NavDashbord/>
        <Sidebar/>
        <BrowserRouter>  

      <Route   path="/ftage/dashboard"> <Admin></Admin> </Route>



  </BrowserRouter>
      </div>
    </Router>
  );
}

export default Admin;
